import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, IconButton, Button } from '@mui/material';
import {Delete, Edit} from '@mui/icons-material';

const Tables = ({contacts, deleteContact, editContact}) => {
    return (
        <TableContainer>
            <Table>
                <TableHead>
                    <TableRow>
                        {['First Name', 'Last Name', 'Email', 'Phone', 'Company', 'Job Title', 'Actions'].map((col) => (
                            <TableCell key={col}>{col}</TableCell>
                        ))}
                    </TableRow>
                </TableHead>
                <TableBody>
                        {contacts.map((contact) => (
                        <TableRow key={contact._id}>
                        <TableCell>{contact.firstName}</TableCell>
                        <TableCell>{contact.lastName}</TableCell>
                        <TableCell>{contact.email}</TableCell>
                        <TableCell>{contact.phone}</TableCell>
                        <TableCell>{contact.company}</TableCell>
                        <TableCell>{contact.jobTitle}</TableCell>
                        <TableCell>
                            <IconButton onClick={() => editContact(contact)}>
                            <Edit />
                            </IconButton>
                            <IconButton onClick={() => deleteContact(contact._id)}>
                            <Delete />
                            </IconButton>
                        </TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
};

export default Tables;
